import React from 'react';

const HomePage = () => {
    return (
        <div className="min-h-screen bg-gradient-to-b from-[#ff5002] to-[#150824]">
            {/* Top bar */}
            <div className="bg-[#150824] flex justify-between items-center p-4 rounded-b-lg">
                {/* Logo */}
                <img src="https://pdf-background-images.s3.us-east-2.amazonaws.com/logo.png" alt="Logo" className="h-10" />
                {/* Login Button */}
                <button className="bg-white text-[#150824] px-4 py-2 rounded-md hover:bg-gray-200 transition">
                    Log In
                </button>
            </div>

            {/* Content */}
            <div className="flex justify-center items-center h-full">
                {/* Additional content can go here */}
            </div>
        </div>
    );
}

export default HomePage;
